import React from 'react';
import './App.css';

function App() {

  const allTodos = ["vai", "porra", "desgraça", "filho", "da", "puta"]

  const [todos, setAllTodos] = React.useState(allTodos);

  const deleteEntry = ( todoIndex ) => {
    todos.filter((_, index) => index !== todoIndex)

  }

  return (
    <div className="App">
      <header className="App-header" />
      <ul> 
      {todos.map((todo, index) => 
        <li>{todo}<button onClick={() => deleteEntry(index)}>Del</button></li>)}
        </ul>
        <input />
    </div>
  );
}

export default App;
